// src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';

// Importujemy globalne style
import './index.css'; 

// Importujemy główny komponent aplikacji
import App from './App';

// Znajdujemy element 'root' w naszym HTML
const root = ReactDOM.createRoot(document.getElementById('root'));

// Renderujemy naszą aplikację wewnątrz React.StrictMode,
// który pomaga w wykrywaniu potencjalnych problemów w aplikacji.
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
